comb :: Int -> [a]-> [[a]]
comb k [] = [[]]
comb 0 l =[[]]
comb k (x:xs)
    | k > 1+length(xs) = [[]]
    | otherwise = [y|y<-((comb k xs ) ++ (map (x:) (comb (k-1) xs ))),length(y)==k]


convertString::[Char]->[Char]
