replace_char::[Char]->Char->Char->[Char]
replace_char l a b = [if(x==a) then b else x | x<-l]

replace_char2 l a b  = [if(x==b) then a else (if (x == a) then b else x) | x<-l]

bigrams::[Char]->[[Char]]
bigrams l = if ((length l) < 2 ) then [] else [[l!!i,l!!(i+1)]| i<-[0..((length l)-2)]]

trigrams::[Char]->Float->Float
trigrams l x = if ((length l) < 3 )  then x else trigrams (tail l) ((score (map toUpper [l!!0,l!!1,l!!2]))+x) 
pos::Char->Int
pos c = if (isUpper c) then ((ord c)-(ord 'A')) else ((ord c)-(ord 'a'))

convertChar::[Char]->Char->Char
convertChar key ch = key!!(pos(ch))

decryptString::[Char]->[Char]->[Char]
decryptString code key = map (convertChar key) code

score::[Char]->Float
score l
    | M.lookup l1 d == Nothing = fromIntegral(minBound::Int)
    | (Just x)<-(M.lookup l1 d)  = x
    | otherwise = 0
     where l1= map toUpper l 

rscore::[Char]->Float
rscore l = (trigrams l 0)

-- swap 
swappedKey::[Char]->[Int]->[Char]
swappedKey l l1 = [if(i==a) then l!!b else if(i==b) then l!!a else l!!i|i<-[0..(length(l)-1)]]
                   where a=l1!!0
                         b=l1!!1
final::[Char]->[Char]->([Char],[Char])
final code key
    | [x|x<-list1,(rscore (decryptString code (swappedKey key x)))>rscore1]==[] = ((decryptString code key),key)
    | otherwise = final code (swappedKey key (head [x|x<-list1,(rscore (decryptString code (swappedKey key x)))>rscore1]))
                where 
                      list1 = ((comb 2 [0..25]))
                      rscore1=(rscore (decryptString code key))


insIndices::[Char]->[Int]
insIndices text = [i|i<-[0..((length text)-1)],((isAlpha (text!!i))/=True)] 

insertAtPos::[Char]->Char->Int->[Char]
insertAtPos l c i = (take (i) l ) ++ [c] ++ (reverse (take (len-i) (reverse l)))
                     where len=length l

insertAtAllPos::[Char]->[Char]->[Int]->[Char]
insertAtAllPos l text [] = l
insertAtAllPos l text l1 = insertAtAllPos (insertAtPos l (text!!(l1!!0)) (l1!!0)) text (tail l1)

decrypt :: [Char]->[Char]
decrypt code = m3 
        where 
            text1=convertString code
            m1=snd (final (take 1000 text1) ['A'..'Z'])
            m2=decryptString text1 m1
            l3=insIndices code
            m3=insertAtAllPos m2 code l3


total_score text = (sum (a1),sum (a3) )
            where 
            a1 =  [ (if( (map toLower (list!!i)) `elem` dict) then 1 else 0) | i<-[0.. length (list)-1 ] ]
            list = words a2
            a2 = [x | x<-text,( (isAlpha x == True || x == ' '))]
